--drop table "M210"."constructors" cascade constraints ;
--drop table "M210"."results" cascade constraints ;
--drop table "M210"."constructor_standings" cascade constraints ;
--drop table "M210"."constructor_results" cascade constraints ;
--drop table "M210"."laptimes" cascade constraints ;
